import { showRenewHistory } from "../actions/actions"

class GetRequest {
  static async getHistory() {
    try {
      fetch('/his')
        .then((response) => response.json())
        .then((data) => dispatch(showRenewHistory))
    } catch (e) {
      throw new Error(e)
    }
  }
}

export default GetRequest
